import React from "react";
import styled from "styled-components";

const LeaguesOverviewComponent = styled.div`
  .leagus_overview {
    display: flex;
    flex-direction: column;
    width: 30%;
    min-width: 400px;
    margin: 25px;
    padding: 20px;
    border: 2px solid var(--border_light);
    border-radius: 5px;
    background-color: var(--navbar_color);
    z-index: 3;
  }
`;

function LeaguesOverview({ leagues }) {
  return (
    <LeaguesOverviewComponent>
      <div className="leagus_overview">
        {Object.keys(leagues).map((league) => (
          <span>{leagues[league].name}</span>
        ))}
      </div>
    </LeaguesOverviewComponent>
  );
}

export default LeaguesOverview;
